import React from "react";
import { CardWrapper, DashboardWrapper } from "./styles";

const Dashboard = () => {
  return (
    <>
      <DashboardWrapper>
        <CardWrapper></CardWrapper>
        <CardWrapper></CardWrapper>
      </DashboardWrapper>
    </>
  );
};

export default Dashboard;
